import {Component, OnInit} from '@angular/core';
import {FormBuilder, FormGroup, Validators} from "@angular/forms";
import {Subject} from "../../model/subject.model";
import {SubjectService} from "../subject.service";
import {ActivatedRoute, Router} from "@angular/router";
import {SchoolModel} from "../../model/school.model";
import {SchoolService} from "../school.service";

@Component({
  selector: 'app-subject-add',
  templateUrl: './subject-add.component.html',
  styleUrls: ['./subject-add.component.css']
})
export class SubjectAddComponent implements OnInit{
  myForm!: FormGroup;
  subject: Subject | undefined
  formSubmitted: boolean = false

  id: string | undefined

  constructor(private fb: FormBuilder,
              private sServ: SubjectService,
              private activatedRoute: ActivatedRoute,
              private router: Router){};

  submitForm() {
    console.log(this.myForm.value);
    this.formSubmitted = true
    if (this.myForm.valid) {
      this.sServ.add(this.myForm.value)
        .subscribe(s =>
          this.router.navigate(['../'], {relativeTo: this.activatedRoute}))
    }
  };

  ngOnInit(): void {
    this.id = this.activatedRoute.snapshot.paramMap.get("sId") || "";
    if (this.id != '') {
      this.sServ.getOne(+this.id).subscribe(v => {
        this.subject = v
      this.myForm.get('name')?.setValue(this.subject.name)
      this.myForm.get('color')?.setValue(this.subject.color)
    })
  }

    this.myForm = this.fb.group({
      name: [this.subject?.name || '', Validators.required],
      color: [this.subject?.color || '', Validators.required],
      school: {id:this.id}
    })


  }

}
<div class="corps">
  <div class="container">
        <form [formGroup]="myForm" (ngSubmit)="submitForm()">
          <h1>Ajouter une matière</h1>
          <div class="text-danger">
            <ul *ngIf="formSubmitted">
              <li *ngIf="myForm.controls['name'].errors?.['required']">Le nom est requis</li>
              <li *ngIf="myForm.controls['color'].errors?.['required']">La couleur est requise</li>
            </ul>
          </div>
              <div class="field">
                <label for="name">Nom de la matière</label>
                <input type="text" id="name" formControlName="name">
              </div>
              <div class="field">
                <label for="color">Couleur</label>
                <input type="text" id="color" formControlName="color">
              </div>

            <button class="btn btn-outline-primary" type="submit" type="button" routerLink="../">Ajouter</button>
            <span><button class="btn btn-outline-primary" type="button" routerLink="../">Annuler</button></span>

        </form>
      </div>
    </div>
